-- Create verification summary
SELECT 'FINAL IMPORT SUMMARY' as report;
SELECT 
    label,
    COUNT(*) as meter_count
FROM water_meters
GROUP BY label
ORDER BY 
    CASE label 
        WHEN 'L1' THEN 1
        WHEN 'L2' THEN 2
        WHEN 'L3' THEN 3
        WHEN 'L4' THEN 4
        WHEN 'DC' THEN 5
        WHEN 'N/A' THEN 6
    END;

-- Verify all zones are present
SELECT 
    zone,
    COUNT(*) as meters_in_zone
FROM water_meters
GROUP BY zone
ORDER BY zone;